import Dialog from '@material-ui/core/Dialog';

interface Props {
    children: React.ReactNode;
    open: boolean;
  }

const CustomDialog = ({ open, children }: Props): JSX.Element => {
    return (
        <Dialog open={open}>{children}</Dialog>
    )
};

export default CustomDialog;
